import React from 'react';
import NavMenu from './components/NavMenu';
import AnimBorder from './components/AnimBorder';
import Competences from './components/Competences';

function App() {
  return (
    <div className="App">
      <NavMenu />

      <Competences />
      <AnimBorder />
    </div>
  );
}

export default App;
